import React from 'react'
import { Link, Outlet } from 'react-router-dom'
import alertify from 'alertifyjs';


export default function Dashboard() {
    window.onload = function() {
        alertify.success('Post created successfully', { 
            position: 'top-right',
            background: 'var(--color-5)',
            color: 'var(--color-1)',
            padding: '10px',
            borderRadius: '5px',
            fontSize: '20px',
          });
    }
  return (
        <>

    
           <div className="links d-flex justify-content-around align-items-center">
                <Link className='on-hover-green' to="/dashboard/debug-stress">
                    Debug Stress
                    <hr className="green"/>
                </Link>
                <Link className='on-hover-green' to="/dashboard/inspect-world">
                    Inspect World
                    <hr className="green"/>
                </Link>
            </div>
            <div className="main-body">


                <Outlet />
           
         

            </div>

    </>
  )
}
